import styled from "styled-components";

export const LightText = styled.h1`
  font-size: 16px;
  line-height: 33px;
  color: #6B6B6B;
  font-weight: light;
`;

export const Picture = styled.img`
  max-width: 35vw;
  height: auto;
  margin-left: 91px;
  margin-top: 90px;
  margin-right: 73px;
`;
